    "\n",
    "print(f\"\\nüî¨ COSMOLOGICAL PARAMETERS:\")\n",
    "print(f\"   H‚ÇÄ Planck: {cosmo.H0_planck} km/s/Mpc\")\n",
    "print(f\"   H‚ÇÄ SH0ES: {cosmo.H0_sh0es} km/s/Mpc\")\n",
